import './CSS/Main.css'

export function Title(params){
    return(
        <div className="title">
            <h1>{params.title}</h1>
        </div>
    );
}

export function SubTitle(params){
    return(
        <div className="subtitle">
            <h3>{params.title}</h3>
        </div>
    );
}


